schemaDefinition: "create or replace view V_NOW_ON_NOW_EVENTS_DATA(\n\tEVENT_DATE,\n\
  \tEVENT_MONTH,\n\tSPEAKER,\n\tEXECUTIVE,\n\tCAMPAIGN_NAME,\n\tEVENT_NAME,\n\tPIPELINE_INFLUENCED,\n\
  \tPIPELINE_CREATED,\n\tPIPELINE_CLOSED\n) as(\nselect\nEVENT_DATE\n,EVENT_MONTH\n\
  ,SPEAKER\n,EXECUTIVE\n,CAMPAIGN_NAME\n,EVENT_NAME\n,round((REGEXP_REPLACE(PIPELINE_INFLUENCED,\
  \ 'random', 'random')),'random') as PIPELINE_INFLUENCED\n,round((REGEXP_REPLACE(PIPELINE_CREATED,\
  \ 'random', 'random')),'random') as PIPELINE_CREATED\n,round((REGEXP_REPLACE(PIPELINE_CLOSED,\
  \ 'random', 'random')),'random') as PIPELINE_CLOSED\nfrom RDS.FLATFILESOURCE.TBL_NOW_ON_NOW_EVENTS_DATA);"
